import Header from "../components/Header";

function Favourites({ children, cities }) {
    document.title = "Ulubione";
    return (
        <div>
            <Header />
            {cities.map((city) => {
                return <div>{city}</div>;
            })}
        </div>
    );
}

export default Favourites;

